Description. Size, 14.2 mm x 6.0 mm. shining blackish-bronze dorsally with foveae slightly brighter in color; more shining ventrally than above. Head dull greenish with some bronze on raised areas on lower frons, becoming bronze on occiput. Occiput with broad, smooth, grooved longitudinal carina forming an indistinct Y anteriorly; frons nearly flat with purple-maroon chevron parallel to arms of Y that become broader as it approaches eyes; frons with punctures less well defined than those on occiput, and clothed with long white setae that curve downward apically. Clypeus green, margin black, semicircularly rounded on each side of median notch, becoming yellow-copper between antennal bases. Basal eight antennomeres green with apical antennomeres coppery-maroon, and four basal antennomeres equal in length to apical seven. Pronotum 1.7 times wider than long, widest at anterior 1 / 6 , sides sloping slightly toward base from anterior to posterior; narrowest at base, disc slightly concave anteromedially, irregular smooth area about depression, with many transverse ridges lacking medially, otherwise irregularly punctate with slightly elevated smooth spaces. Scutellum smooth, triangular, dark blackish-green. Elytra wider than pronotum, sides rounded in front, subparallel to widest behind middle, lateral margin arcuate with serrulations largest on apical half; surface glabrous with irregular longitudinal, smooth costae connected to one another by small, irregular, smooth ridges, and interrupted by irregular densely punctured depressed areas; sutural costa quite distinct from basal 1 / 5 to apex; transverse foveae shallow and indistinct, appearing goldish-black. Underside: proventrite irregularly punctate with many long white setae; shiny bronze, greenish on posterior margin of abdominal ventrites, laterally magenta on irregular raised areas; disc of abdomen rubbed smooth; irregularly punctate with a rather long white semierect seta in each puncture, lateral edges of abdominal ventrites 2, 3 , and 4 with green, gold, magenta, and blue color ending on apical lateral angle; last visible ventrite emarginate at apex with lateral margin coarsely serrulate. Legs: femora greenish-bronze, less color on metafemora; protibia with anterior margin greenish, strongly arcuate with eight teeth on inner margin, and ten smaller teeth on inner margin of each mesotibia; tarsi green. Male genitalia (
Fig. 24
) rather elongate and not very wide, parameres equal in length.

Allotype female. Size, 15.0 mm x 6.4mm. frons reticulated, bronze with irregular shaped transverse callosity between and just above antennal sockets, weaker in center of frons; a broad chevron-like callosity, pointing toward vertex, and weaker in center of frons. Clypeal margin narrow black and adjacent area greenish. Female pygidium (
Fig. 36
) with deep depression on either side of median carina, and large tubercles within depression. Males: 9.2 – 13.8 mm long, 3.9 – 6.1 mm wide; Females: 10.9 – 17.1 mm long, 4.9 – 7.0 mm wide.
